#!/bin/bash


# Usage: ./getogimage.sh <URL> <TAG1> [TAG2...] -- <TITLE WORDS>
#
# Arguments:
#   URL   - The webpage URL to screenshot
#   TAGS  - One or more tags (space-separated) to display on the OG image
#   --    - Delimiter separating tags from title
#   TITLE - Title words for the OG image (also used as filename)
#
# Example:
#   ./getogimage.sh https://example.com/blog/post fsharp dotnet ai -- understanding fsharp

# Validate minimum arguments
if [ $# -lt 4 ]; then
  echo "Error: Missing required arguments"
  echo "Usage: ./getogimage.sh <URL> <TAG1> [TAG2...] -- <TITLE WORDS>"
  exit 1
fi

URL=$1
shift

# Collect tags until we hit "--"
TAGS=""
while [ $# -gt 0 ] && [ "$1" != "--" ]; do
  if [ -n "$TAGS" ]; then
    TAGS="$TAGS $1"
  else
    TAGS="$1"
  fi
  shift
done

# Skip the "--" delimiter
if [ "$1" = "--" ]; then
  shift
else
  echo "Error: Missing '--' delimiter between tags and title"
  echo "Usage: ./getogimage.sh <URL> <TAG1> [TAG2...] -- <TITLE WORDS>"
  exit 1
fi

# Remaining arguments form the title
TITLE="$*"

if [ -z "$TAGS" ] || [ -z "$TITLE" ]; then
  echo "Error: Both tags and title are required"
  echo "Usage: ./getogimage.sh <URL> <TAG1> [TAG2...] -- <TITLE WORDS>"
  exit 1
fi

KEY=94f4f9
FILENAME="${TITLE// /}"
FILEPATH="./themes/hugo-nord-blog/static/images/${FILENAME}.png"

curl -Gs "https://api.screenshotmachine.com?key=$KEY&url=$URL&device=desktop&dimension=1024x768&format=png&zoom=200" > "$FILEPATH"

IMAGE_BASE64=$(base64 -i "$FILEPATH")

# Create temp file for JSON payload (avoids "argument list too long" error)
TEMP_JSON=$(mktemp)
trap "rm -f $TEMP_JSON" EXIT

cat > "$TEMP_JSON" << ENDJSON
{
  "name": "og:image-right",
  "params": {
    "tag": {
      "text": "${TAGS}",
      "fontFamily": "inter",
      "fontWeight": 400,
      "fontSize": 20,
      "color": "#030712"
    },
    "title": {
      "text": "${TITLE}",
      "fontFamily": "inter",
      "fontWeight": 700,
      "fontSize": 60,
      "color": "#030712"
    },
    "logo": {
      "url": "data:image/png;base64,"
    },
    "image": {
      "url": "data:image/png;base64,${IMAGE_BASE64}"
    }
  },
  "background": {
    "type": "linear-gradient",
    "colorStops": [
      "#f5f7fa 0%",
      "#c3cfe2 100%"
    ],
    "direction": "to top right",
    "noise": 0.15,
    "gridOverlay": {
      "pattern": "dots",
      "color": "#030712",
      "opacity": 0.5,
      "blurRadius": 20
    }
  },
  "canvas": {
    "width": 1200,
    "height": 630
  }
}
ENDJSON

curl -H "Content-Type: application/json" \
  https://ogimage.click/api/v1/images \
  -d @"$TEMP_JSON" -s > $FILEPATH
